import React, { Component } from "react";
import "./App.css";
import CustomLayout from './containers/layout'

class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <CustomLayout {...this.props}>
            <BaseRouter />
          </CustomLayout>

        </Router>

      </div>
    );
  }

}

export default App;
